import React from "react";

const Blog=(state)=>{

    const{items,DeleteItem}= this.state.state;

const Add=items.map(item=>{

return(
<div key={item.id}>
    {item.name}
<button onClick={()=>DeleteItem(item.id)} className='Btn'>DeleteBtn</button>

</div>

)
})



return
(
    <div>{Add}</div>
 

)
}
export default Blog;
